       this.setState({datum : new Date().toLocaleString()});

        return (  
            <div>
                <h1>Margin Level Calculator</h1>
                <input type="number" id="1" name="tradecollateral" placeholder="Trade Collateral" />
                <br></br>
                <input type="number" id="2" name="accountballance" value="" placeholder="Account Ballance" />
