                <p>Aktueller Preis: </p> 
                <p>Kursverlauf:</p>
                <p>Profit/Loss:</p>  
                <p>Leverage (Gehebelter Betrag):</p> 
                <p>Equity:</p>  
                <p>Marginlevel:</p>            
            </div>
        );
    }
}

export default NewPosition;
